from __future__ import annotations
from typing import Optional

# Definition for singly-linked list.

class ListNode:
    def __init__(self, val: int = 0, next: Optional[ListNode] = None):
        self.val = val
        self.next = next

class LinkedList:
    def __init__(self):
        self.head: ListNode | None = None
        self.last: ListNode | None = None

    def insert(self, val: int):
        new_node: ListNode | None = ListNode(val)
        if self.head == None:
            self.head = new_node
            self.last = self.head
        else:
            last_node: ListNode | None = self.last
            if last_node is not None:
                last_node.next = new_node
            self.last = new_node

    def print_ll(self):
        cur: ListNode | None = self.head
        ll_str = ""
        if cur != None:
            ll_str: str = f'{str(cur.val)} -> '
            while cur.next:
                cur = cur.next
                ll_str += f'{str(cur.val)} -> '
            ll_str += "None"
        print(ll_str)

    def insert_arr(self, arr: list[int]):
        for val in arr:
            self.insert(val)

# utility function
def print_ll_from_head_node(head: ListNode | None) -> None:
    ll: str = ""

    while head:
        ll += f'{str(head.val)} -> '
        head = head.next
    
    ll += "None"
    print(ll)


class Solution:
    def sortList(self, head: Optional[ListNode]) -> Optional[ListNode]:
        def merge_sort(head: ListNode | None) -> ListNode | None:

            if head == None or head.next == None:
                return head

            prev_mid: ListNode | None = None # node just before the middle node
            fast: ListNode | None = head

            while fast and fast.next:
                prev_mid = head if prev_mid == None else prev_mid.next
                fast = fast.next.next

            assert prev_mid is not None
            mid: ListNode | None = prev_mid.next
            prev_mid.next = None  # this should split the linked list into right (head == head) and left (head == mid) list
            
            left_head = merge_sort(head)
            right_head = merge_sort(mid)

            dummy_head: ListNode | None = ListNode(0)  # this node is for tracking the head of the sorted linked list
            curr: ListNode | None = dummy_head 

            while curr and left_head and right_head:  # curr is used for type narrowing
                if left_head.val < right_head.val:
                    curr.next = left_head
                    curr = curr.next
                    left_head = left_head.next

                else:
                    curr.next = right_head
                    curr = curr.next
                    right_head = right_head.next
                
            curr.next = left_head if left_head is not None else right_head

            return dummy_head.next  # sorted (left + right) list
        
        return merge_sort(head)



